const orangeTheme = {
	colors: {
		background: '#ffffff',
		opposite: '#272727',

		Primary: '#FFF8ED',
		Secondary: '#FFE3B9',
		Tertiary: '#FFC977',
		Quaternary: '#DEAD63',
		Quinary: '#A68350',
	},
};

export default orangeTheme;
